import React from 'react'
import axios from 'axios';
const TodosList = ({todos, setTodos,editTodo ,setEditToDo,apiInput,setapiInput, request, setRequest}) => {

  const handleDelete = async ({id}) => {
    setTodos(todos.filter((todo) => todo.id !== id));
    
    axios.get("https://630fada536e6a2a04edfbc08.mockapi.io/todos").then((res) => {
       const returnId = res.id;
       console.log(res.data.length);
       for(const i=0; i< res.data.lenght; i++){
        console.log("for döngüsü " + "" + res.data[i].todoid)
          if(res.data[i].todoid.id === request.id){
            console.log("tamam")
          }
       }
       console.log(res.data)
       console.log(request.id)
       if(res.id == request.id){
        console.log("if girdi")
         axios.delete("https://630fada536e6a2a04edfbc08.mockapi.io/todos/"+res.id,{
          
        }).then(() => {alert("Todo delete!"); setapiInput(null)})
       }
       else{
          console.log("else girdi")
       }
      }, [])}
   
  const handleEdit = ({id}) => {
    const findTodo = todos.find((todo) => todo.id === id);
    setEditToDo(findTodo);
  }

  return (
    <div>
        {todos.map((todo) => (
            <li className='list-item' key={todo.id}>
                <input 
                  type="text" 
                  value = {todo.title} 
                  className= {`list ${todo.completed} ? "completed" : "" `} 
                  onChange={(e) => e.preventDefault()} 
                />
                <div>
                
                <button className='button-edit' onClick={() => handleEdit(todo)}> Edit</button>
                <button className='button-delete' onClick={() => handleDelete(todo)}>Delete</button>
                
                </div>
            </li>
        ))}
    </div>
  );
};

export default TodosList
